  false,\n\t\"url\": null,\n\t\"notes\": \"Areas within Idaho where air pollution
  levels persistently exceed the national ambient air quality standards may be designated
  \"nonattainment.\" EPA considers any geographic area that meets or has pollutant
  levels below the NAAQS an attainment area. Under ideal circumstances, all of Idaho
  would be classified as u00e2u0080u009cattainment.u00e2u0080u009d An area with persistent
  high pollutant levels is designated a nonattainment area. This means that the area
  has violated federal health-based standards for outdoor air pollution. Each nonattainment
  area is declared for a specific pollutant. This means that the same area could be
  u00e2u0080u009cattainmentu00e2u0080u009d for one pollutant, but u00e2u0080u009cnonattainmentu00e2u0080u009d
  for a different pollutant. Nonattainment areas for different pollutants may overlap
  each other or share common boundaries.\",\n\t\"license_title\": null,\n\t\"extras\":
